import React, { useState } from 'react';
import Child from './child';

function Parent() {
  const [count, setState] = useState(0);

  const increment = () => {
    setState((count = count + 1));
  };

  return (
    <div>
      {count}
      {increment}
      <Child value={count} func={setState} />
    </div>
  );
}

export default Parent;
